import React from 'react';

export default function UserList ( {contacts} ){
    return(
        <div>
            {contacts.map((contact) => (
                <tr key={contact.phone}>
                    <td>{contact.first_name}</td>
                    <td>{contact.last_name}</td>
                    <td>{contact.email}</td>
                    <td>{contact.phone}</td>
                </tr>
            ))}
        </div>
    )
}
